INSERT INTO `content` VALUES (1, '鲸yu的自述', '池鲤', '日常生活', '2021年06月20日', '喜欢', '我是一头鲸，而且是海洋中最大最大的鲸－蓝鲸又，名剃刀鲸。 我生活在辽阔的海洋里，我有好多兄弟姐妹，还有好多的朋友，在深深的海洋里遨游。 我高兴的时候，就会浮上海面，跟蓝天白云打个招呼；我心烦的时候，就潜入海底，谁找我也不理。当风和日丽的时候，我游到海边，浮出海面，远远地望着陆地、高山，心想：我们祖先是从哪里来的呀？ 要讲我的祖先，那就得从4.5亿年前说起了。 那时由古总鳍鱼演化成两栖类、爬行类、鸟类和脯乳类，直到距今7000万年前，我们祖先才从脯乳类分化出来。 那时祖先们还在陆地上，后来占领了海洋，在浅海中生活，最后适应了海洋的生活，演变成了我们现在的鲸。 我们这么大，肚子也一定大，这么大肚子，要吃什么呢？我吃小鱼小虾的时候，先把肚子撑大，连同海水一齐吞入口中，然后闭上嘴，把水压出去，只咽下食物。为什么我们吃小鱼小虾呢？因为我们没牙齿，不能咀嚼食物，所以只能吃小鱼小虾，虽然它们小，但很多，不愁饿肚子。 你知道吗？我的肺重约1500公斤，可吸15000公升的空气，可以在水下呆十八分钟，换气时，由于压力过大，不仅声音大，海上还会出现“喷泉”，可漂亮了！喷出十几米高，然后四处散开落在海上，打起水花，远远望去，就像节日里的烟花，漂亮极了！ 我是一头鲸，而且是海洋中最大最大的鲸－蓝鲸，又名剃刀鲸。我生活在辽阔的海洋里，我有好多兄弟姐妹，还有好多的朋友，在深深的海洋里遨游。我高兴的时候，就会浮上海面，跟蓝天白云打个招呼；我心烦的时候，就潜入海底，谁找我也不理。当风和日丽的时候，我游到海边，浮出海面，远远地望着陆地、高山，心想：我们祖先是从哪里来的呀？ 要讲我的祖先，那就得从4.5亿年前说起了。那时由古总鳍鱼演化成两栖类、爬行类、鸟类和脯乳类，直到距今7000万年前，我们祖先才从脯乳类分化出来。那时祖先们还在陆地上，后来占领了海洋，在浅海中生活，最后适应了海洋的生活，演变成了我们现在的鲸。我们这么大，肚子也一定大，这么大肚子，要吃什么呢？我吃小鱼小虾的时候，先把肚子撑大，连同海水一齐吞入口中，然后闭上嘴，把水压出去，只咽下食物。为什么我们吃小鱼小虾呢？因为我们没牙齿，不能咀嚼食物，所以只能吃小鱼小虾，虽然它们小，但很多，不愁饿肚子。 你知道吗？我的肺重约1500公斤，可吸15000公升的空气，可以在水下呆十八分钟，换气时，由于压力过大，不仅声音大，海上还会出现“喷泉”，可漂亮了！喷出十几米高，然后四处散开落在海上，打起水花，远远望去，就像节日里的烟花，漂亮极了！ 这就是我，生活在深海里的脯乳动物－鲸，也是你们人类的好朋友', 'https://ss3.bdstatic.com/70cFv8Sh_Q1YnxGkpoWK1HF6hhy/it/u=3601187226,2793957193&fm=26&gp=0.jpg', 'false', 'true', 100);
INSERT INTO `content` VALUES (47, '成功属于你们', '池鲤', '兴趣爱好', '2021年07月04日', 'css', '<p><span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">每一份辛劳都有一份收获，每一次的痛苦都是</span>	<a href=\"https://www.59wz.com/zuowen/kuaile/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(247, 9, 104); background-color: rgb(255, 255, 255);\">快乐</a>	<span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">的开始，每一声呐喊都是力量的呼唤。我们有着大浪拍岸的豪迈，所以你不必在乎小荷初露的恬静，我们有着春日的</span>	<a href=\"https://www.59wz.com/zuowen/yangguang/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(247, 9, 104); background-color: rgb(255, 255, 255);\">阳光</a>	<span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">明媚，所以不用去羡慕冬日乱玉碎琼，我们是</span>	<a href=\"https://www.59wz.com/zuowen/yu/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(247, 9, 104); background-color: rgb(255, 255, 255);\">雨</a>	<span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">天的一把伞，是</span>	<a href=\"http://www.zixuekaoshi.net/zuowen/hanleng/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(247, 9, 104); background-color: rgb(255, 255, 255);\">寒冷</a>	<span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">冬日里的一盆碳火，</span>	<a href=\"https://www.59wz.com/zuowen/wennuan/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(247, 9, 104); background-color: rgb(255, 255, 255);\">温暖</a>	<span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">的不只是你我，而是大家的心。运动场上的健儿，掌声属于你们，鲜花属于你们，</span>	<a href=\"https://www.59wz.com/zuowen/chenggong/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(247, 9, 104); background-color: rgb(255, 255, 255);\">成功</a>	<span style=\"color: rgb(68, 68, 68); background-color: rgb(255, 255, 255);\">也是属于你们！1</span></p>', 'https://img2.baidu.com/it/u=2791667199,575391347&fm=26&fmt=auto&gp=0.jpg', 'false', 'true', 40);
INSERT INTO `content` VALUES (48, '假如生活欺骗了你', '池鲤', '日常生活', '2021年07月02日', '喜欢', '假如生活欺骗了你， 不要悲伤，不要心急！ 忧郁的日子里须要镇静： 相信吧，快乐的日子将会来临！ 心儿永远向往着未来； 现在却常是忧郁。 一切都是瞬息，一切都将会过去； 而那过去了的，就会成为亲切的怀恋。', 'https://cdn.jsdelivr.net/gh/ihewro/blog@master/usr/uploads/2019/01/762065921.jpg', 'false', 'false', 39);
INSERT INTO `content` VALUES (49, '截取字符串的方法', '池鲤', '技巧杂烩', '2021年06月30日', 'js', '<p>如何设置去截取字符串</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">str = str.slice(<span class=\"hljs-number\">0</span>);<span class=\"hljs-regexp\">//</span>返回整个字符串 abcdef\nstr = str.substring(<span class=\"hljs-number\">0</span>);<span class=\"hljs-regexp\">//</span>返回整个字符串 abcdef\nstr = str.substr(<span class=\"hljs-number\">0</span>);<span class=\"hljs-regexp\">//</span>返回整个字符串 abcdef\n\n<span class=\"hljs-regexp\">//</span> 使用一个参数\nstr = str.slice(<span class=\"hljs-number\">2</span>);<span class=\"hljs-regexp\">//</span>截取第二个之后所有的字符 cdef\nstr = str.substring(<span class=\"hljs-number\">2</span>);<span class=\"hljs-regexp\">//</span>截取第二个之后所有的字符 cdef\nstr = str.substr(<span class=\"hljs-number\">2</span>);<span class=\"hljs-regexp\">//</span>截取第二个之后所有的字符 cdef\n&nbsp;\n<span class=\"hljs-regexp\">//</span> 使用两个参数\nstr = str.slice(<span class=\"hljs-number\">2</span>,<span class=\"hljs-number\">4</span>);<span class=\"hljs-regexp\">//</span>截取第二个到第四个之间的字符 cd\nstr = str.substring(<span class=\"hljs-number\">2</span>,<span class=\"hljs-number\">4</span>);<span class=\"hljs-regexp\">//</span>截取第二个到第四个之间的字符 cd\nstr = str.substr(<span class=\"hljs-number\">2</span>,<span class=\"hljs-number\">4</span>);<span class=\"hljs-regexp\">//</span>截取从第<span class=\"hljs-number\">3</span>个开始往后数<span class=\"hljs-number\">4</span>位之间的字符 cdef\n&nbsp;\n<span class=\"hljs-regexp\">//</span> 使用两个负数\nstr = str.slice(<span class=\"hljs-number\">1</span>,-<span class=\"hljs-number\">3</span>);<span class=\"hljs-regexp\">//</span>截取第二个到第四个之间的字符 bc\nstr = str.substring(<span class=\"hljs-number\">1</span>,-<span class=\"hljs-number\">3</span>);<span class=\"hljs-regexp\">//</span>截取第二个到第四个之间的字符 a <span class=\"hljs-comment\">#负数转换为0</span>\nstr = str.substr(<span class=\"hljs-number\">1</span>,-<span class=\"hljs-number\">3</span>);<span class=\"hljs-regexp\">//</span>不能为负数，若强行传递负数，会被当成<span class=\"hljs-number\">0</span>处理 <span class=\"hljs-string\">\' \'</span> <span class=\"hljs-comment\">#负数转换为0</span>\nconsole.log(str)\n</pre><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', 'https://ss2.bdstatic.com/70cFvnSh_Q1YnxGkpoWK1HF6hhy/it/u=1080931513,887107117&fm=26&gp=0.jpg', 'false', 'true', 37);
INSERT INTO `content` VALUES (53, '瓶子', '池鲤', '学习笔记', '2021年06月17日', '喜欢', '<p><span style=\"color: rgb(51, 51, 51);\">“我们来个小测验。”专家拿出一个一加仑的广口瓶放在桌上。随后，他取出一堆拳头大小的石块，把它们一块块地放进瓶子里，直到石块高出瓶口再也放不下了。他问：“瓶子满了吗”所有的学生应道：“满了。”他反问：“真的”说着他从桌下取出一桶砾石，倒了一些进云，并敲击玻璃壁使砾石填满石块间的间隙。“此刻瓶子满了吗”这一次学生有些明白了，“可能还没有。”一位学生应道。“很好!”他伸手从桌下又拿出一桶沙子，把它慢慢倒进玻璃瓶。沙子填满了石块和砾石的所有间隙。他又一次问学生：“瓶子满了吗”“没满!”学生们大声说。然后专家拿过一壶水倒进玻璃瓶直到水面与瓶口齐平。他望着学生</span></p>', 'https://ss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=3206689113,2237998950&fm=26&gp=0.jpg', 'false', 'true', 24);
INSERT INTO `content` VALUES (54, '湘西秘闻', '池鲤', '兴趣爱好', '2021年06月30日', '有趣的分享', '<p>喜欢灵异故事的人一听听说过湘西赶尸，这种听起来非常神秘而且不可思议的事情，对于现代的人来说完全属于天方夜谭，但小编负责任的告诉你湘西赶尸是真实存在的！</p><p>赶尸作为苗族一种民俗事项，是巫术的一部分。 赶尸，也与蛊毒、落花洞女一起，并称为“湘西三邪”。</p><p>尽管“湘西赶尸”从未得到科学验证，也并未被亲眼证实，但是却成为很多惊悚电影的原型，从此广为人知。赶尸，属苗族蛊术，是楚巫文化的一部分，亦说与茅山术祝由科有关，又称移灵，发源于古辰州沅陵、泸溪、辰溪、溆浦四县。清朝就广为流传湘西“赶尸人”的传闻，即赶尸人利用“秘术”，将客死异乡的人的尸体带回家乡，让他们入土为安。</p><p>神话起源</p><p>赶尸的起源，民间有书记载：相传几千年以前，苗族的祖先阿普（苗语：公公）蚩尤率兵在黄河边与敌对阵厮杀，直至尸横遍野，血流成河。打完仗要往后方撤退，士兵们把伤兵都抬走后，阿普蚩尤命令阿普军师把战死的弟兄送回故里。</p><p>于是阿普军师装扮成阿普蚩尤的模样，站在战死的弟兄们的尸首中间，在一阵默念咒语、祷告神灵后，原本躺在地上的尸体一下子全都站了起来，跟在阿普蚩尤高擎的“符节”后面规规矩矩向南走。敌人的追兵来了，阿普蚩尤和阿普军师连手作法引来“五更大雾”，将敌人困在迷魂阵里……这便是赶尸的最早版本。清代中期，赶尸技术出现，是把客死四川的湖南移民的尸体运送回家乡。尸体在最开始的运送过程中，是走的水路，并不需要“赶”的。但三峡这一段，水流湍急，旋涡暗礁密布，船只往往沉没。古人又迷信，绝不愿意搭载死人走在险江之上，“赶尸”这个职业于是就产生了。传言抗战期间，重庆打铜街一个住家屋檐下，在门框上还贴着一张纸条，上面写着“代办运尸还湘”。所谓“赶尸”，其实就是“背尸”而已。赶尸匠找人将尸体分尸，然后在残肢上喷特制药水，防止尸体的残肢腐烂。一个人背上残肢，套在既长且大的黑袍里，头戴大草帽，将整个头部覆盖无余，连面部的轮廓也难叫人看得清楚。另一个人扮成“赶尸术士”在前面扔黄纸，摇铃铛，给背尸人指引方向。两人还故意造出恐怖气氛使人不敢与之接近，如果路途遥远两人的角色就一日一换。</p><p>无论是背尸还是分尸，都有一个关键的问题，就是尸体的防腐，因为赶尸的路都在山区，少则需十天半月，多则一个多月。学者研究认为，湘西的崇山峻岭生长各种草药，苗族先民总结出一套独特的苗医苗药体系。其中，有一项是对尸体做去水处理后，进行草药熏蒸，尸体就可以长时间不腐烂。</p>', '//bpic.588ku.com/illus_water_img/21/04/08/bb375f99eea3f6855e4c95af6d63295a.jpg!/fw/750/quality/99/unsharp/true/compress/true', 'false', 'true', 82);
INSERT INTO `content` VALUES (103, 'vue简介', '池鲤', '学习笔记', '2021年06月19日', 'Vue', '<p><strong>一、基本介绍</strong></p><p> 1、Vue.js目前最火的的一个前端框架，三大主流前端框架之一。</p><p> 2、Vue.js是一套构建用户界面的框架（一套完整的解决方案，对项目侵入性大，中途需要跟换框架则需要重构整个项目），只关注视图层，易上手，有配套的第三方类库。</p><p> 3、提高开发效率，帮助减少不必要的dom操作；双向数据绑定，通过框架提供的指令，前端只需要关注业务逻辑，不再关心dom如何渲染。</p><p><br></p><p><br></p><p> <strong>二、前端的MVVM</strong></p><p> 1、前端视图层的概念，主要把每个页面分成了M（Model）、V（View）、VM（VM ViewModel）。VM是其中核心，M和V间的调度者。</p><p> 2、M，保存的是每个页面中单独的数据（比如要渲染页面表格，ajax请求到后台的你个数组，此数据即为M）。</p><p> 3、V，每个页面的html结构。</p><p> 4、VM，一个调度者，分割了M和V，M和V不直接关联，通过中间的VM。V想要保存数据到M，都要有VM做中间处理；V想要渲染页面，需要调用VM，VM从M中取数据。</p><p> 5、前端中使用MVVM思想，主要让开发更方便，MVVM提供了数据的双向绑定（由VM提供）。</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">html&gt;\n    &lt;head&gt;\n        &lt;meta charset=\"utf-8\"&gt;\n        &lt;title&gt;&lt;/title&gt;\n        &lt;!-- 导入vue的包 --&gt;\n        &lt;script src=\"https://cdn.jsdelivr.net/npm/vue/dist/vue.js\"&gt;&lt;/script&gt;\n    &lt;/head&gt;\n    &lt;body&gt;\n        &lt;!-- 将来的Vue实例会控制这个元素中所有内容 --&gt;\n        &lt;!-- V（View），Vue实例所控制的这个元素区域 --&gt;\n        &lt;div id=\"app\"&gt;   \n            &lt;!-- 通过Vue提供的指令，很方便就能把data里的数据渲染到页面，不用手动操作dom了\n           （前端Vue之类的框架，不提倡去手动操作dom） --&gt;\n            &lt;p&gt;{{ msg }}&lt;/p&gt;\n        &lt;/div&gt;\n        \n        &lt;script&gt;\n            //导入包,就有Vue的构造函数\n            //VM,这个new出来的vm对象,就是调度者\n            var vm = new Vue({   //{}配置对象\n                el:\'#app\',   //element,这个Vue实例要控制页面上的哪个区域\n                data:{   //M,data就是用来保存当前页面数据的\n                    msg:\'欢迎学习Vue\'\n                }\n            })  \n        &lt;/script&gt;\n    &lt;/body&gt;\n&lt;/html&gt;\n</pre>', 'https://ss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=3481523356,85204117&fm=11&gp=0.jpg', 'false', 'true', 12);
INSERT INTO `content` VALUES (104, 'vue全家桶', '池鲤', '编程技术', '2021年06月25日', '工作', '<h4>二、Vue</h4><p>Vue 是一套用于构建用户界面的渐进式框架，和React，都自称自己只关注视图层</p><p><br></p><h5>1.引入Vue</h5><ul><li>开发环境：</li></ul><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"https://cdn.jsdelivr.net/npm/vue/dist/vue.js\"</span>&gt;&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n</pre><ul><li>生产环境：</li></ul><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">script</span> <span class=\"hljs-attr\">src</span>=<span class=\"hljs-string\">\"https://cdn.jsdelivr.net/npm/vue\"</span>&gt;&lt;/<span class=\"hljs-name\">script</span>&gt;</span>\n</pre><h5><br></h5><h5>2.一个小demo</h5><p>在完成Vue都引入后，再分别 编写DOM 和 新建Vue实例：</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-comment\">&lt;!-- 两对花括号</span>{{}}<span class=\"hljs-comment\"> 为模版语法。\n这里渲染message变量，也就是下面new Vue时data.message --&gt;</span>\n<span class=\"hljs-tag\">&lt;<span class=\"hljs-name\">div</span> <span class=\"hljs-attr\">id</span>=<span class=\"hljs-string\">\"app\"</span>&gt;</span>\n  {{ <span class=\"hljs-name\">message</span> }}\n<span class=\"hljs-tag\">&lt;/<span class=\"hljs-name\">div</span>&gt;</span>\nvar app = new Vue({\n  el: \'#app\',  // 选择器，用来找到id为app的DOM节点\n  data: {  // data属性用来存储数据\n    message: \'Hello Vue!\'\n  }\n})\n</pre><p><br></p><p><br></p><p><br></p><h4>三、Vue-router</h4><h5>1.功能</h5><p>Vue-router可以帮你：</p><ul><li>嵌套的路由/视图表</li><li>模块化的、基于组件的路由配置</li><li>路由参数、查询、通配符</li><li>基于 Vue.js 过渡系统的视图过渡效果</li><li>细粒度的导航控制</li><li>带有自动激活的 CSS class 的链接</li><li>HTML5 历史模式或 hash 模式，在 IE9 中自动降级</li><li>自定义的滚动条行为</li></ul><p><br></p><p><br></p><p><br></p><p><br></p><h4>四、Vuex</h4><p>如同React有Redux一样，Vuex 是一个专为 Vue.js 应用程序开发的状态管理模式，适合开发大型单页应用。</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-keyword\">new</span> Vue({\n  <span class=\"hljs-comment\">// state</span>\n  data () {\n    <span class=\"hljs-keyword\">return</span> {\n      <span class=\"hljs-keyword\">count</span>: <span class=\"hljs-number\">0</span>\n    }\n  },\n  <span class=\"hljs-comment\">// view</span>\n  template: `\n    &lt;<span class=\"hljs-keyword\">div</span>&gt;{{ <span class=\"hljs-keyword\">count</span> }}&lt;/<span class=\"hljs-keyword\">div</span>&gt;\n  `,\n  <span class=\"hljs-comment\">// actions</span>\n  methods: {\n    increment () {\n      <span class=\"hljs-keyword\">this</span>.<span class=\"hljs-keyword\">count</span>++\n    }\n  }\n})\n</pre><h4><br></h4><h4><br></h4><h4><br></h4><h4>五、axios</h4><h5>1.简介</h5><p>axios 是一个基于Promise 用于浏览器和 nodejs 的 HTTP 客户端，它可以帮你：</p><ul><li>从浏览器中创建 XMLHttpRequest</li><li>从 node.js 发出 http 请求</li><li>支持 Promise API</li><li>拦截请求和响应</li><li>转换请求和响应数据</li><li>取消请求</li><li>自动转换JSON数据</li><li>客户端支持防止 CSRF/XSRF</li></ul><h5>2.一个小demo</h5><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-regexp\">//</span> 创建示例\nconst instance = axios.create();\n\n<span class=\"hljs-regexp\">//</span> 指定超时时间\ninstance.defaults.timeout = <span class=\"hljs-number\">2500</span>;\n\n<span class=\"hljs-regexp\">//</span> get请求longRequest， 为这个接口单独指定<span class=\"hljs-number\">5</span>s的超时时间\ninstance.get(<span class=\"hljs-string\">\'/longRequest\'</span>, {\n  timeout: <span class=\"hljs-number\">5000</span>\n});\n\n<span class=\"hljs-regexp\">//</span> 正常get请求\naxios.get(<span class=\"hljs-string\">\'/user?ID=12345\'</span>)\n  .then(<span class=\"hljs-keyword\">function</span> (response) {\n    <span class=\"hljs-regexp\">//</span> 处理成功返回\n    console.log(response);\n  })\n  .catch(<span class=\"hljs-keyword\">function</span> (error) {\n    <span class=\"hljs-regexp\">//</span> 处理错误\n    console.log(error);\n  })\n  .finally(<span class=\"hljs-keyword\">function</span> () {\n    <span class=\"hljs-regexp\">//</span> 处理无论成功/失败都执行的代码\n  });\n</pre><p><br></p>', 'https://ss0.bdstatic.com/70cFuHSh_Q1YnxGkpoWK1HF6hhy/it/u=1485012388,2380514454&fm=26&gp=0.jpg', 'false', 'true', 29);
INSERT INTO `content` VALUES (107, '致运动员们', '池鲤', '生活趣事', '2021年06月19日', '有趣的分享', '<p>	<strong style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">致运动员，是</strong><strong>	</strong><a href=\"http://www.zixuekaoshi.net/zuowen/tiyu/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(247, 9, 104);\"><strong>体育</strong></a><strong>	</strong><strong style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">场上游走的火焰，是来去不息的脚步，是风中飞舞的</strong><strong>	</strong><a href=\"https://www.59wz.com/zuowen/shuye/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(247, 9, 104);\"><strong>树叶</strong></a><strong>	</strong><strong style=\"background-color: rgb(255, 255, 255); color: rgb(68, 68, 68);\">折射的金色光芒，藉此，可以诠释运动员兴奋的脸庞。那轻盈的步伐似飞鸟的翅膀，那清脆的枪声响彻天际，它粲然升起那跃动的渴望，起跑、加速、超越、冲刺，一步一步延向胜利的曙光。那是力的比拼，素质的较量，是石榴树上，跃动的心脏。</strong></p>', 'https://ss2.bdstatic.com/70cFvnSh_Q1YnxGkpoWK1HF6hhy/it/u=3004960263,3049501113&fm=26&gp=0.jpg', 'false', 'true', 6);
INSERT INTO `content` VALUES (114, 'JS获取指定日期距离当前日期还有多久', '池鲤', '技巧杂烩', '2021年06月30日', 'js', '<pre class=\"ql-syntax\" spellcheck=\"false\">/**\n  * 获取距离指定时间还有多少天\n  * @param {String | Number | Date} dateTime 日期时间\n  * @example\n  * ```javascript\n  *     getDistanceSpecifiedTime(\'2019/02/02 02:02:00\');\n  *     getDistanceSpecifiedTime(1549036800000);\n  *     getDistanceSpecifiedTime(new Date(\"2019/2/2 00:00:00\"));\n  * ```\n  */\nfunction getDistanceSpecifiedTime(dateTime) {\n    // 指定日期和时间\n    var EndTime = new Date(dateTime);\n    // 当前系统时间\n    var NowTime = new Date();\n    var t = EndTime.getTime() - NowTime.getTime();\n    var d = Math.floor(t / 1000 / 60 / 60 / 24);\n    var h = Math.floor(t / 1000 / 60 / 60 % 24);\n    var m = Math.floor(t / 1000 / 60 % 60);\n    var s = Math.floor(t / 1000 % 60);\n    var html = d + \" 天\" + h + \" 时\" + m + \" 分\" + s + \" 秒\";\n    console.log(html);\n}\n</pre><p><br></p>', 'https://ss0.bdstatic.com/70cFuHSh_Q1YnxGkpoWK1HF6hhy/it/u=2496571732,442429806&fm=26&gp=0.jpg', 'false', 'true', 24);
INSERT INTO `content` VALUES (116, '如何安装使用Git，及Git基本操作命令', '池鲤', '学习笔记', '2021年06月26日', 'Git', '<p><br></p><p><strong>1.根据自己的电脑下载自己适合自己版本的git，可以直接使用安装包或者官网下载。</strong></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><strong>2.直接无脑安装一直点击Next就可以。</strong></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>3.安装成功以后，点击鼠标右键会出现 GUI Here 和 Bash Here 证明安装成功。</strong></p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>4.点击 Bash Here , 进入输入命令行的终端，以后 git 的操作都将在此终端进行操作。</strong></p><p><br></p><p><strong>﻿</strong><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>5.在使用git的时候我们需要做一个一次性配置，方便 git 以后可以跟踪到谁做了修改。我们需要设置对应的用户名与邮箱地址</strong></p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">﻿<span class=\"hljs-regexp\">//</span> 设置用户名\ngit confing --global user.name <span class=\"hljs-string\">\"你所设置的用户名\"</span>\n﻿\n﻿﻿<span class=\"hljs-regexp\">//</span> 设置邮箱\ngit confing --global user.email  你的邮箱地址\n\n<span class=\"hljs-regexp\">//</span> 查看配置\ngit confing --list\n\n</pre><p><br></p><p><br></p><p><strong><em>基本git的安装和配置就是这样。</em></strong></p>', 'https://img0.baidu.com/it/u=3444172184,182344165&fm=26&fmt=auto&gp=0.jpg', 'false', 'true', 17);
INSERT INTO `content` VALUES (117, 'Git连接github并上传自己的第一个项目。', '池鲤', '学习笔记', '2021年07月01日', 'Git', '<p><br></p><h2><strong>1.登录 github 点击右上角的 </strong>New <strong>创建一个新仓库。</strong></h2><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>2.输入自己创建仓库名称</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><strong>3.创建完成的样子，可以先不用管。</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><strong>4.开启git的命令行可以看一下子自己有没有shh密钥，如果有下面的文件夹就证明有 如果没有就需要用命令生成 shh 密钥</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><strong>5.此行代码生成 ssh 密钥 ，输入这个命令以后会出现如下提示需要你填写，大体意思就是你希望在何处生成密钥，</strong><strong style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">创建密钥必须在c盘，你可以在要求输入邮箱的时候直接按空格，这样他就会自动生成在 {c盘-用户-自己的用户名-.ssh}这个地址</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">。</span><strong>填写完成后直接生成密匙。 </strong></p><pre class=\"ql-syntax\" spellcheck=\"false\"> ssh-keygen -<span class=\"hljs-built_in\">t</span> rsa -C <span class=\"hljs-string\">\"把这里的邮箱换成你注册时候的邮箱\"</span>\n</pre><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>7.进入文件管理器找到.shh文件夹打开你会看见里面有三个文件，打开以.pub结尾的文件，点击并复制里面的东西。一个符号也不能落下</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>8.点击github里面的设置，里面选项有一个ssh密钥点击进去，点击生成新的密钥，吧刚才复制的.pub结尾的文件里面的东西复制进去，然后点击确定就设置好了ssh密匙</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>9.打开需要自己上传的项目，鼠标右键点击 gitBashHere 进入git的控制工具</strong></p><p><br></p><p><strong>10.输入命令 git init 初始化创建这个仓库。</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>11.输入 git add . 选择上传这个文件夹里面的所有文件, add 后面的点代表上传这个文件夹里面所有的内容。 如果想单独上传某个文件 那么命令就是 git add 后面加上你想上传当前文件夹那个文件的名字就行，记住单独文件上传不需要加点。</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>12.输入 git commit -m \"update\" 类似于评论之类的东西 具体可以参考官方文档</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>13.管理 github仓库，打开刚才github创建的仓库，复制其ssh地址。在git命令行输入 </strong><span style=\"color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">git remote add origin 加上刚才复制的 ssh地址</span></p><p><img src=\"data:image/png;base64,\"></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong>14.命令行输入 </strong><strong style=\"color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">git push -u origin master 上传代码,项目上传完毕。刷新页面看看</strong></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong><u>小贴士： 如果项目更新的话只需要执行以下操作：</u></strong></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">git add . </span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">git commit -m “update”（或想要更新的文件名）</span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">git push</span></p><p><strong><u>这样就可以更新完毕。</u></strong></p><p><br></p><h2><strong><u>多人协作，下载可以查看下一篇文章 Git + 码云操作 操作步骤基本一样</u></strong></h2>', 'https://img1.baidu.com/it/u=3356417196,2837443394&fm=26&fmt=auto&gp=0.jpg', 'false', 'true', 27);
INSERT INTO `content` VALUES (118, 'Git + 码云的使用方法', '池鲤', '学习笔记', '2021年06月30日', 'Git', '<h1><br></h1><h2>连接码云并上传本地项目</h2><p>1. 申请一个码云账号并登录,创建一个项目并复制里面的 ssh 地址。</p><p><br></p><p>2. 点击设置，进入ssh秘钥设置，和 github 一样复制 .pub 文件夹里面的东西，添加秘钥。（如果不知道如何查看和生成秘钥可以看本博客有关 github 的文章里面有详细提到）</p><p><br></p><p>3. 进入想要上传的项目文件夹 点击鼠标右键 Git Bash Here 进入到命令行工具</p><p><br></p><p>4. 初始化项目 。 输入下方命令，这时候你会看到文件夹会出现一个 git文件夹， 如果没有出现那可能是隐藏了，可以设置一下文件夹里面的隐藏文件夹出现。</p><pre class=\"ql-syntax\" spellcheck=\"false\">git <span class=\"hljs-keyword\">init</span>\n</pre><p><br></p><p>5. 连接项目，输入命令下方命令，并加上你刚才创建项目时候复制的 ssh 地址</p><pre class=\"ql-syntax\" spellcheck=\"false\">git remote <span class=\"hljs-keyword\">add origin </span>复制的ssh地址\n</pre><p><br></p><p>6. 将文件添加进入缓存区。输入下方命令，将文件添加进入缓存区 （后面的 . 代表吧当前文件夹所有的文件添加进去，如果想添加单一的文件，后面就直接跟上需要添加的文件名称就好）</p><pre class=\"ql-syntax\" spellcheck=\"false\">git <span class=\"hljs-built_in\">add</span> .\n</pre><p><br></p><p>7. 添加注释，来说明为什么要上传，方便以后查阅。输入下方命令</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-attribute\">git</span> commit -m <span class=\"hljs-string\">\"第一次上传\"</span>\n</pre><p><br></p><p>8.提交到码云仓库上面去输入以下代码 （第一次上传该项目需加上 -u 如果更新操作则不需要）</p><pre class=\"ql-syntax\" spellcheck=\"false\">git push -u origin  <span class=\"hljs-keyword\">master</span>\n</pre><p><br></p><p><br></p><p><strong>更新项目：</strong>（执行 6-8步骤就行）第8步时候去掉 -u 就好 。</p><p><br></p><p><br></p><p><em><u>我是一条分割线 </u></em></p><p><br></p><p><br></p><h2><strong>下载别人的码云项目：</strong></h2><p>1.	创建空白文件夹，输入 git init</p><pre class=\"ql-syntax\" spellcheck=\"false\">git <span class=\"hljs-keyword\">init</span>\n</pre><p><br></p><p>2. git remote add origin + 要下载的码云地址</p><pre class=\"ql-syntax\" spellcheck=\"false\">git remote <span class=\"hljs-keyword\">add origin </span>要下载项目ssh地址\n</pre><p><br></p><p>3.拉取该地址下的所有文件到本地文件夹中去</p><pre class=\"ql-syntax\" spellcheck=\"false\">git pull origin <span class=\"hljs-keyword\">master</span>\n</pre><h2><br></h2><h2><br></h2><h2>多人协作，将代码上传至分支</h2><p>（上传分支时，要记得切换分支，否则上传不上去会报错）</p><p>1.切换对应的分支</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-attribute\">git</span> checkout 分支的名字\n</pre><p><br></p><p>2.添加需要添加的文件到缓存区</p><pre class=\"ql-syntax\" spellcheck=\"false\">git <span class=\"hljs-built_in\">add</span> .\n</pre><p><br></p><p>3.提交备注信息</p><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-attribute\">git</span> commit -m  ‘分支测试’\n</pre><p><br></p><p>4.提交到对应的分支</p><pre class=\"ql-syntax\" spellcheck=\"false\">git <span class=\"hljs-built_in\">push</span> <span class=\"hljs-built_in\">origin</span>  分支的名字\n</pre><p><br></p><p><br></p><p><br></p><h2>Git基本指令</h2><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">\ngit checkout : 切换分支\ngit <span class=\"hljs-keyword\">clone </span>xxxxx :克隆到本地\ngit <span class=\"hljs-keyword\">branch </span>: 添加分支\ngit <span class=\"hljs-built_in\">config</span>：配置信息\ngit <span class=\"hljs-keyword\">add：添加文件到缓存命令\n</span>git status：查看文件的状态命令\ngit <span class=\"hljs-keyword\">diff：查看更新的详细信息命令\n</span>git commit：提交命令\ngit reset HEAD：取消缓存命令\ngit rm：删除命令\ngit mv：移动或重命名命令\n</pre>', 'https://img1.baidu.com/it/u=4082919469,838277269&fm=26&fmt=auto&gp=0.jpg', 'false', 'true', 25);
INSERT INTO `content` VALUES (119, 'axios封装，及其全局路由守卫使用', '池鲤', '技巧杂烩', '2021年07月14日', '日常分享', '<p><br></p><p><br></p><p><strong>github地址: </strong>git@github.com:Wzw123106/axios-.git</p><p><br></p><p>api.js : 里面放置接口地址</p><p>index.js : 请求拦截器和响应拦截器根据自己需求改，还有axios的配置对象</p><p><br></p><p>使用：下载axios, github下载完成封装好的以后，将http文件夹放置在src文件夹目录下即可 。min.js 全局挂载封装好的axios</p><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">全局引入\n<span class=\"hljs-comment\">//&nbsp;引入封装好的axios</span>\n<span class=\"hljs-keyword\">import</span>&nbsp;http&nbsp;<span class=\"hljs-keyword\">from</span>&nbsp;<span class=\"hljs-string\">\'./http\'</span>\n<span class=\"hljs-title class_\">Vue</span>.<span class=\"hljs-property\"><span class=\"hljs-keyword\">prototype</span></span>.<span class=\"hljs-property\">$http</span>&nbsp;=&nbsp;http\n\n\n使用:\n  无参数请求\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-variable language_\">this</span>.$http({<span class=\"hljs-attr\">method</span>:<span class=\"hljs-string\">\'get\'</span>,<span class=\"hljs-attr\">url</span>:<span class=\"hljs-string\">\'users_add\'</span>})\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;.<span class=\"hljs-title function_\">then</span>(<span class=\"hljs-function\">(<span class=\"hljs-params\">res</span>)=&gt;</span>{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-variable language_\">console</span>.<span class=\"hljs-title function_\">log</span>(res.<span class=\"hljs-property\">list</span>)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;})&nbsp;\n\n  有参数请求\n          <span class=\"hljs-variable language_\">this</span>.$http({\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attr\">method</span>:<span class=\"hljs-string\">\'post\'</span>,\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attr\">url</span>:<span class=\"hljs-string\">\'users_delect\'</span>,\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attr\">params</span>:{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attr\">id</span>:<span class=\"hljs-number\">79</span>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;})\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;.<span class=\"hljs-title function_\">then</span>(<span class=\"hljs-function\">(<span class=\"hljs-params\">res</span>)=&gt;</span>{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-variable language_\">console</span>.<span class=\"hljs-title function_\">log</span>(res)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;})   \n</pre><p><br></p><p><br></p><h2>全局路由守卫示例</h2><pre class=\"ql-syntax\" spellcheck=\"false\"><span class=\"hljs-comment\">//&nbsp;全局路由守卫</span>\nrouter.<span class=\"hljs-title function_\">beforeEach</span>(<span class=\"hljs-function\">(<span class=\"hljs-params\">to,&nbsp;<span class=\"hljs-keyword\">from</span>,&nbsp;next</span>)&nbsp;=&gt;</span>&nbsp;{\n&nbsp;&nbsp;<span class=\"hljs-comment\">//&nbsp;判断是否存在toke值</span>\n&nbsp;&nbsp;<span class=\"hljs-keyword\">const</span>&nbsp;token&nbsp;=&nbsp;<span class=\"hljs-variable language_\">window</span>.<span class=\"hljs-property\">localStorage</span>.<span class=\"hljs-title function_\">getItem</span>(<span class=\"hljs-string\">\'data\'</span>)\n&nbsp;&nbsp;<span class=\"hljs-keyword\">if</span>(token){\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-title function_\">next</span>();\n&nbsp;&nbsp;}<span class=\"hljs-keyword\">else</span>{\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-title function_\">alert</span>(<span class=\"hljs-string\">\"请登录\"</span>)\n&nbsp;&nbsp;}\n})\n</pre>', 'https://img0.baidu.com/it/u=1245409484,876937459&fm=26&fmt=auto&gp=0.jpg', 'true', 'true', 10);
INSERT INTO `content` VALUES (120, 'CSS技巧杂烩', '池鲤', '技巧杂烩', '2021年07月02日', 'css', '<p><br></p><h2>1.div整体居中显示</h2><pre class=\"ql-syntax\" spellcheck=\"false\">&nbsp;.nav{\n  &nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">width</span>:&nbsp;<span class=\"hljs-number\">300px</span>;\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">height</span>:&nbsp;<span class=\"hljs-number\">300px</span>;\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">background-color</span>:&nbsp;red;\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">margin</span>:&nbsp;<span class=\"hljs-number\">0</span>&nbsp;auto;\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">position</span>:&nbsp;relative;\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-comment\">/*&nbsp;top:&nbsp;50%;&nbsp;*/</span>\n&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">transform</span>:&nbsp;<span class=\"hljs-built_in\">translateY</span>(<span class=\"hljs-number\">50%</span>);\n&nbsp;}\n</pre><p><br></p><p><br></p><p><br></p><h2>2.内容超出该元素出现滚动条并滚动条隐藏</h2><pre class=\"ql-syntax\" spellcheck=\"false\">&nbsp;<span class=\"hljs-comment\">/*&nbsp;个人页&nbsp;*/</span>\n&nbsp;.lefts{\n&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">width</span>:&nbsp;<span class=\"hljs-number\">20%</span>;\n&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">height</span>:&nbsp;<span class=\"hljs-number\">93%</span>;\n&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">float</span>:&nbsp;left;\n&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">background-color</span>:&nbsp;<span class=\"hljs-built_in\">rgb</span>(<span class=\"hljs-number\">249</span>,<span class=\"hljs-number\">249</span>,<span class=\"hljs-number\">249</span>);\n&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">margin-top</span>:&nbsp;<span class=\"hljs-number\">5%</span>;\n&nbsp;&nbsp;&nbsp;<span class=\"hljs-attribute\">overflow</span>:auto;\n&nbsp;}\n&nbsp;<span class=\"hljs-comment\">/*&nbsp;隐藏滚动条&nbsp;*/</span>\n  .lefts::-webkit-scrollbar&nbsp;{display:none;}\n</pre><p><br></p><h2>3,文本内容溢出显示省略号</h2><pre class=\"ql-syntax\" spellcheck=\"false\"> \n   单行文本溢出隐藏\n   <span class=\"hljs-attribute\">overflow</span>:hidden;\n&nbsp; <span class=\"hljs-attribute\">text-overflow</span>:ellipsis;<span class=\"hljs-comment\">/*当对象内文本溢出时显示省略标记(...)；需与overflow:hidden;一起使用。*/</span>\n\n    多行文本溢出隐藏\n    <span class=\"hljs-attribute\">overflow</span>: hidden;\n    <span class=\"hljs-attribute\">text-overflow</span>: ellipsis;\n    <span class=\"hljs-attribute\">display</span>: -webkit-box;\n    -webkit-line-clamp: <span class=\"hljs-number\">5</span>;\n    -webkit-box-orient: vertical;\n\n</pre>', 'https://img1.baidu.com/it/u=3086121024,713970673&fm=26&fmt=auto&gp=0.jpg', 'false', 'true', 6);
INSERT INTO `content` VALUES (121, 'js获取固定范围内的随机数', '池鲤', '学习笔记', '2021年07月02日', 'js', '<p><br></p><p><br></p><p>js获取固定范围内的随机数</p><pre class=\"ql-syntax\" spellcheck=\"false\">Math.<span class=\"hljs-built_in\">floor</span>(Math.<span class=\"hljs-built_in\">random</span>()* 获取的范围值)\n</pre><p><br></p><p><br></p>', 'https://img1.baidu.com/it/u=2252593823,4141088280&fm=26&fmt=auto&gp=0.jpg', 'false', 'true', 1);

